// @lc code=start
class Solution {
    public boolean isSubsequence(String s, String t) {
        int i=0,j=0;
        boolean ans =false;
        if(s.length()==0){
            return true;
        }
        else if(t.length()==0){
            return false;
        }
        while(j<t.length()&&i<s.length()){
            if(s.charAt(i)==t.charAt(j)){
                i++;
            }
            j++;
        }
        if(i==s.length()){
            ans=true;
        }
        return ans;
    }
}
